import React, { useState, useEffect } from "react";
import Pagination from "./Pagination";

function GraphComponent() {
  const data = [
    { graphName: "Graph 1", stsName: "Tuning Set 1" },
    { graphName: "Graph 2", stsName: "Tuning Set 1" },
    { graphName: "Graph 3", stsName: "Tuning Set 2" },
  ];

  const [currentPage, setCurrentPage] = useState(1);
  const [recordsPerPage] = useState(2);
  const indexOfLastRecord = currentPage * recordsPerPage;
  const indexOfFirstRecord = indexOfLastRecord - recordsPerPage;
  var currentRecords;
  if (data) {
    currentRecords = data.slice(indexOfFirstRecord, indexOfLastRecord);
  }
  var nPages;
  if (data && data !== undefined && data !== null) {
    nPages = Math.ceil(data.length / recordsPerPage);
  }

  useEffect(() => {
    setCurrentPage(1);
  }, [nPages]);

  const renderTableData = () => {
    return currentRecords.map((dra, index) => {
      const { graphName, stsName } = dra;

      let viewGraph = <button className="btn">View Graph</button>;
      let deleteGraph = <button className="btn-red">Delete Graph</button>;

      return (
        <tr key={index}>
          <td>{graphName}</td>
          <td>{stsName}</td>
          <td>
            {viewGraph} &emsp; &emsp; &emsp;{deleteGraph}
          </td>
        </tr>
      );
    });
  };

  return (
    <div className="form">
      <h4>Graph</h4>
      <br />
      <br />
      <br />
      <table className="table">
        <thead>
          <tr className="tr">
            <th style={{ backgroundColor: "#41afca", color: "#f1f5f9" }}>
              Graph Name
            </th>
            <th style={{ backgroundColor: "#41afca", color: "#f1f5f9" }}>
              STS Name
            </th>
            <th style={{ backgroundColor: "#41afca", color: "#f1f5f9" }}>
              Actions
            </th>
          </tr>
        </thead>
        <tbody>{renderTableData()}</tbody>
      </table>

      <br />

      <Pagination
        nPages={nPages}
        currentPage={currentPage}
        setCurrentPage={setCurrentPage}
      />
    </div>
  );
}

export default GraphComponent;
